import react from "react";
import { useNavigation } from '@react-navigation/native';


const HomePage = () => {
    const navigation = useNavigation();

    const NavigateToLogin = () => {
        navigation.navigate('Login');
      };

    const NavigateToSignUp = () => {
        navigation.navigate('SignUp')
    }

    return (
        <>
            <div className="appInfo">
                <image source={require("https://www.google.com/imgres?imgurl=https%3A%2F%2Fstatic.vecteezy.com%2Fsystem%2Fresources%2Fpreviews%2F001%2F198%2F236%2Foriginal%2Fdiamond-png.png&tbnid=O5vRGSkaJ2nl8M&vet=12ahUKEwjPj-TAjNCCAxVD2zgGHfylCiUQMygEegQIARB2..i&imgrefurl=https%3A%2F%2Fwww.vecteezy.com%2Fpng%2F1198236-diamond&docid=bK3FzDVgxblYuM&w=688&h=524&q=pink%20diamond%20png&ved=2ahUKEwjPj-TAjNCCAxVD2zgGHfylCiUQMygEegQIARB2")}/>
                <h1>
                    TeamUP
                </h1>
                <p>The app tagline goes here</p>
            </div>
            <div className="Navbar">
                <div className="login">
                    <h2 onClick={NavigateToLogin}>LOGIN</h2>
                </div>
                <div className="signUp">
                    <h2 onClick={NavigateToSignUp}>SIGN UP</h2>
                </div>
            </div>
        </>

    )

}

export default HomePage;
